import React from 'react';
import {FaSave, FaUserAlt, FaWallet}  from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import * as IoIcons from 'react-icons/io';
import {IoMdLogOut} from 'react-icons/io';

export const SidebarData = [
  {
    title: 'Home',
    path: '/dashboard',
    icon: <AiIcons.AiFillHome style={{color:'#3ac162'}} className="side-icon"/>,
    cName: 'nav-text'
  },
  {
    title: 'My Learning',
    path: '/dashboard/mylearning',
    icon: <IoIcons.IoIosPaper style={{color:'#3ac162'}}/>,
    cName: 'nav-text'
  },
  {
    title: 'Saved Courses',
    path: '/products',
    icon: <FaSave style={{color:'#3ac162'}}/>,
    cName: 'nav-text'
  },
  {
    title: 'Posted Courses',
    path: '/team',
    icon: <IoIcons.IoMdPeople  style={{color:'#3ac162'}}/>,
    cName: 'nav-text'
  },
  {
    title: 'My Profile',
    path: '/messages',
    icon: <FaUserAlt  style={{color:'#3ac162'}}/>,
    cName: 'nav-text'
  },
  {
    title: 'Wallet',
    path: '/support',
    icon: <FaWallet  style={{color:'#3ac162'}}/>,
    cName: 'nav-text'
 },
 {
  title: 'Logout',
  path: '/support',
  icon: <IoMdLogOut  style={{color:'#3ac162'}}/>,
  cName: 'nav-text'
}
];
